Select ModelID, ModelName, Description, Image, MakeID from viconnect.model
USE viconnect;

CREATE TABLE `model` (
  `ModelID` int(11) NOT NULL AUTO_INCREMENT,
  `ModelName` varchar(40) NOT NULL,
  `Description` text,
  `Image` blob,
  `MakeID` int(11) DEFAULT NULL,
  PRIMARY KEY (`ModelID`)
) ENGINE=InnoDB AUTO_INCREMENT=244 DEFAULT CHARSET=latin1;


